Shikari | 1963 | Hindi Action | 1.09 GB | DVDRip | Phantom

Shikari is the story of a mad scientist who establishes a laboratory in the distant jungle of South India. Here he turns a Malayan Gorilla into a twenty feet monster. This gorilla also called Otango, starts a reign of terror in the surrounding villages. Just then, a scientist from Bombay, accompained by a circus party, arrives in these jungles, helped by Ajit, the local hunter. How this Safari faces the hazards of the jungle? How they escape from the cluches of the mad scientist and how Otango meets his doom, is a great big adventure, called SHIKARI.

